  "source": "// SPDX-License-Identifier: MIT\n\npragma solidity ^0.8.0;\n\n//Safe Math Interface\n\ncontract SafeMath {\n\n    function safeAdd(uint a, uint b) internal pure returns (uint c) {\n        c = a + b;\n        require(c >= a);\n    }\n\n    function safeSub(uint a, uint b) internal pure returns (uint c) {\n        require(b <= a);\n        c = a - b;\n    }\n\n    function safeMul(uint a, uint b) internal pure returns (uint c) {\n        c = a * b;\n        require(a == 0 || c / a == b);\n    }\n\n    function safeDiv(uint a, uint b) internal pure returns (uint c) {\n        require(b > 0);\n        c = a / b;\n    }\n}\n\n\n//ERC Token Standard #20 Interface\n\ninterface ERC20Interface {\n    // function totalSupply() external returns (uint);\n    // function balanceOf(address tokenOwner) external view returns (uint balance);\n    function allowance(address tokenOwner, address spender) external view returns (uint remaining);\n    // function transfer(address to, uint tokens) external returns (bool success);\n    function approve(address spender, uint tokens) external returns (bool success);\n    function transferFrom(address from, address to, uint tokens) external returns (bool success);\n    function mint(uint amount) external returns (bool success);\n\n    event Transfer(address indexed from, address indexed to, uint tokens);\n    event Approval(address indexed tokenOwner, address indexed spender, uint tokens);\n    event TokenMinting(uint amount);\n    event BalanceAfterEvaporating(address from, uint balance);\n}\n\n\n//Contract function to receive approval and execute function in one call\n\ninterface ApproveAndCallFallBack {\n    function receiveApproval(address from, uint256 tokens, address token, bytes memory data) external;\n}\n\n//Actual token contract\n\ncontract Valazco is ERC20Interface, SafeMath {\n    string public symbol;\n    string public  name;\n    uint8 public decimals;\n    uint private _totalSupply;\n    address public Owner;\n    uint public holderIndex;\n\n    mapping(address => uint) balances;\n    mapping(address => mapping(address => uint)) allowed;\n    mapping(uint => address) holderList;\n\n    constructor() {\n        Owner = msg.sender;\n        symbol = \"VAL\";\n        name = \"Valazco Token\";\n        decimals = 2;\n        _totalSupply = 800000000;\n        balances[Owner] = _totalSupply;\n        holderIndex = 1;\n        holderList[holderIndex] = msg.sender; \n        emit Transfer(address(0), Owner, _totalSupply);\n    }\n\n    function totalSupply() public view returns (uint) {\n        return _totalSupply  - balances[address(0)];\n    }\n\n    function balanceOf(address tokenOwner) public view returns (uint balance) {\n        return balances[tokenOwner];\n    }\n\n    function transfer(address to, uint tokens) public returns (bool success) {\n        balances[msg.sender] = safeSub(balances[msg.sender], tokens);\n        if( balances[to] == 0) {\n            holderIndex++;\n            holderList[holderIndex] = to;\n        }\n        balances[to] = safeAdd(balances[to], tokens);\n        emit Transfer(msg.sender, to, tokens);\n        return true;\n    }\n\n    function mint(uint _amount) override public returns (bool success) {\n        require(Owner == msg.sender, \"Only Owner can mint\");\n        balances[msg.sender] = safeAdd(balances[msg.sender], _amount);\n        _totalSupply = safeAdd(_totalSupply, _amount);\n        emit TokenMinting(_amount);\n        return true;\n    }\n\n    function approve(address spender, uint tokens) override public returns (bool success) {\n        allowed[msg.sender][spender] = tokens;\n        emit Approval(msg.sender, spender, tokens);\n        return true;\n    }\n\n    function transferFrom(address from, address to, uint tokens) override public returns (bool success) {\n        balances[from] = safeSub(balances[from], tokens);\n        allowed[from][msg.sender] = safeSub(allowed[from][msg.sender], tokens);\n        balances[to] = safeAdd(balances[to], tokens);\n        if( balances[to] == 0) {\n            holderIndex++;\n            holderList[holderIndex] = to;\n        }\n        emit Transfer(from, to, tokens);\n        return true;\n    }\n\n    function allowance(address tokenOwner, address spender) override public view returns (uint remaining) {\n        return allowed[tokenOwner][spender];\n    }\n\n    function approveAndCall(address spender, uint tokens, bytes memory data) public returns (bool success) {\n        allowed[msg.sender][spender] = tokens;\n        emit Approval(msg.sender, spender, tokens);\n        ApproveAndCallFallBack(spender).receiveApproval(msg.sender, tokens, address(this), data);\n        return true;\n    }\n\n    function evaporate() public returns (uint){\n        require(Owner == msg.sender, \"Only Owner can evaporate tokens\");\n        uint _countNewTotalSupply = balances[Owner];\n        for( uint i = 1; i <= holderIndex; i++){\n            address _holder = holderList[i];\n            if(balances[_holder] > 100 && _holder != Owner) {\n                uint _dropsHolderBalance = safeDiv(safeMul(balances[_holder], 6), 100);\n                uint _provBalance = safeSub(balances[_holder], _dropsHolderBalance);\n                if(_provBalance >= 100){\n                    balances[_holder] = _provBalance;\n                } else {\n                    balances[_holder] = 100;\n                }\n                _countNewTotalSupply += balances[_holder];\n            }\n            emit BalanceAfterEvaporating(_holder, balances[_holder]);\n        }\n        _totalSupply = _countNewTotalSupply;\n        return _totalSupply;\n    }\n\n    fallback () external payable {\n        revert();\n    }\n    \n    receive () external payable {\n        revert();\n    }\n}\n",
